start/minimal.html.body:
A simple graph
The first step to use GreyCat is create and connect a simple graph using the following code
//Create a minimal graph with the default configuration
Graph g = new GraphBuilder().build();

//Connect the graph
g.connect(isConnected -> {
        //Display that the graph database is connected!
        System.out.println("Connected : " + isConnected);
        //your next code goes here...
});

Next, create your first node in the graph and set some attributes:
Node sensor0 = g.newNode(0, 0); //create a new node for world 0 and time 0
sensor0.set("snesorId", Type.INT, 12); //set the id attribute as an integer
sensor0.set("name",Type.STRING, "sensor0"); //set the name attribute as a string

//Display the first node we created
System.out.println(sensor0); //print {"world":0,"time":0,"id":1,"snesorId":12,"name":"sensor0"}

Then, let's create a second node and connect the two nodes with a relation
Node room0 = g.newNode(0, 0); //create new node called room for world 0 and time 0
room0.set("name",Type.STRING, "room0"); //set the name attribute
room0.addToRelation("sensors", sensor0); //add the sensor0 to the relation sensors of room0

//Let's display the room0 node to see what's inside
System.out.println(room0); //print {"world":0,"time":0,"id":2,"name":"room0","sensors":[1]}

Finally, relations can be traversed as follows
//iterate over the saved sensors relation from room0
room0.relation("sensors", (Node[] sensors) -> {
        System.out.println("Sensors:");
        for (Node sensor : sensors) {
                System.out.println("\t" + sensor.toString()); //print all the sensor in the room
        }
        //your next code goes here...
    });

Finally, the last step to do is to disconnect the graph database:
//Disconnect the database
g.disconnect(result -> {
        System.out.println("GoodBye!");
});

Note that graph processing and traversing is fully asynchronous. So all operations are done inside of callbacks in order not to block the code execution. You can find the whole code of this tutorial here. The next tutorial explores the temporal aspect of our graph database.

start/temporal.html.body:
Temporal graphs
Many domains, from social networks to cyber-physical systems to enterprise applications, need to deal with dynamic, i.e., time-evolving data. Think of a time-evolving graph like the following figure:

The orange nodes in the graph represent the changes compared to the version before. Over time, both attributes of the nodes, i.e., values, as well as the structure of the graph itself can change arbitrary. Usually, considering only the latest state of the graph is not enough, instead, many applications require to analyse and correlate past data, or need to navigate through the history to analyse trends. That is where the temporal graphs are required.
First, let's create again a graph, just like for the non-temporal previous example
//Create a minimal graph with the default configuration
Graph g = new GraphBuilder().build();
//Connect the graph
g.connect(isConnected -> {
        //Display that the graph database is connected!
        System.out.println("Connected : " + isConnected);
        //your next code goes here...
});

Then, we specify a time point and create nodes, attributes, and relations at this time 0.
long timepoint_0 = 0;  //the timestamp is a long and represents the time concept

Node sensor0 = g.newNode(0, timepoint_0); //the second param is the time
sensor0.set("id", Type.STRING, "4494F");
sensor0.set("name", Type.STRING, "sensor0");
sensor0.set("value", Type.DOUBLE, 0.5); //set the value of the sensor

Nodes can freely 'travel in time'. This operation will create a temporal view of the node at the requested time.
Each travel in time operation is asynchronous and returns in the callback a new node (here called sensor0T1) which is the new version of the node sensor0 but as resolved for the requested time T1.
long timepoint_1 = 100;
sensor0.travelInTime(timepoint_1, (Node sensor0T1) -> {
        sensor0T1.set("value", Type.DOUBLE, 21.3); //update the value of the time now
        //Display the value at time 0
        System.out.println("T0:" + sensor0.toString()); //print T0:{"world":0,"time":0,"id":1,"id":"4494F","name":"sensor0","value":0.5}
        //Display the value at time now
        System.out.println("T1:" + sensor0T1.toString()); //print T1:{"world":0,"time":100,"id":1,"id":"4494F","name":"sensor0","value":21.3}

        //your next code goes here...
});

Here we can see, that the same sensor 0, resolve a value of 0.5 at time 0 and a different value of 21.3 at time T1=100.
The method travelInTime can be used to resolve any node at an arbitrary time point. The default behavior of this function is to resolve efficiently the latest known version of the requested node up till the requested time.
Notice that we didn't need to set the attributes ID and names again at time T1. Since we didn't modify them, the resolver keep the last known values as set at tune T0.
As an example, if we go to time T2=50 with (T0
long timepoint_2= 50;
                 sensor0.travelInTime(timepoint_2, (Node sensor0T2) ->{
                         System.out.println("T2:" + sensor0T2.toString()); //prints T2:{"world":0,"time":50,"id":1,"id":"4494F","name":"sensor0","value":0.5}
                 });

start/manyworld.html.body:
Many-world graphs
Prescriptive analytics call for efficient solutions to explore alternative futures, which inevitably diverge when exploring the effects of what-if decisions. This is shown in the following figure:

The concept of many-world graphs allows to efficiently fork and update thousands of parallel worlds, even for temporal graphs. 
First, we create again a graph, just like for a simple graph
Graph g = new GraphBuilder().build();
g.connect(isConnected -> {
        //your next code goes here...
});

Then, we specify a time point and  a world and create nodes, attributes, and relations. 
long timepoint_0 = 0;
long world_0 = 0; //identifies an alternative

Node sensor0 = g.newNode(world_0, timepoint_0); //the first param is the world
sensor0.set("id", "4494F");
sensor0.set("name", "sensor0");
sensor0.set("value", 26.2); //set the value of the sensor

Node room0 = g.newNode(world_0, timepoint_0); //the first param is the word
room0.set("name", "room0");
room0.add("sensors", sensor0);

In this example, node sensor0 and room0 is created in world_0. Other worlds are not impacted by this change. This allows to efficiently create alternative worlds. The jump function can be used to select an arbitrary node within a world.

start/persistence.html.body:
Persistence
MWG comes with a built-in persistence mechanism. Nodes and relationships are automatically serialized and unserialized by MWG and can be stored in different key/value stores. The following example shows how MWG is configured to use Google's LevelDB as a storage backend.  
Graph g = new GraphBuilder()
    .withMemorySize(10000) //cache size before sync to disk
    .withStorage(new LevelDBStorage("mwg_db"))
    .build();

g.connect(isConnected -> {
    Node sensor = g.newNode(0, System.currentTimeMillis()); //create a new node for world 0 and time 0
    sensor.set("id", Math.abs(rand.nextInt()));
    sensor.set("value", rand.nextInt());
    g.index("sensors", sensor, "id", res -> {
        g.save(saveResult -> {
            g.findAll(0, System.currentTimeMillis(), "sensors", allSensorsNow -> {
                System.out.println("All sensors indexed:");
                for (Node sensorNow : allSensorsNow) {
                    System.out.println("\t" + sensorNow.toString());
                }
            });
        });
    });
});

start/indexing.html.body:
Indexing
MWG allows to index your data for efficient retrieval. Indexing is straightforward. Basically, an index node is a graph node, just like all other nodes. This also implies that index nodes are temporal, i.e., what is indexed by a node depends on the time the index was created (and also the world in which the index was created). 
    Node sensor0 = g.newNode(0, 0);
    sensor0.set("id", "4494F");
    sensor0.set("name", "sensor0");
    sensor0.set("value", 26.2); //set the value of the sensor

    Node room0 = g.newNode(0, 0);
    room0.set("name", "room0");
    room0.add("sensors", sensor0);

    g.index("rooms", room0, "name", processResult -> { //index the node room0
        g.index("sensors", sensor0, "id", processResult2 -> { //index the node sensor0
             g.indexes(0, System.currentTimeMillis(), (String[] indexNames) -> {
                System.out.println("Index names in Graph:");
                    for (String indexName : indexNames) {
                    System.out.println("\t" + indexName);
                }
            });

            g.find(0, System.currentTimeMillis(), "rooms", "name=room0", (Node[] rooms) -> {
                System.out.println("Rooms found by string query:");
                for (Node roomNow : rooms) {
                    System.out.println("\t" + roomNow.toString());
                }
            });

            g.find(0, System.currentTimeMillis(), "sensors", "id=4494F", (Node[] sensors) -> {
                System.out.println("Sensors found by string query:");
                    for (Node sensorNow : sensors) {
                    System.out.println("\t" + sensorNow.toString());
                }
            });

            g.findAll(0, System.currentTimeMillis(), "sensors", allSensorsNow -> {
                System.out.println("All sensors indexed:");
                for (Node sensorNow : allSensorsNow) {
                    System.out.println("\t" + sensorNow.toString());
                }
            });
        });
    });

start/distributed.html.body:
Distribution
MWG allows to seamlessly distribute the graph across computational nodes. 
Therefore, let's first setup a server node, which exposes the many-world graph to clients via websocket. 
Graph g = new GraphBuilder()
    .withMemorySize(10000) //cache size before sync to disk
    .withStorage(new LevelDBStorage("mwg_db"))
    .build();

 g.connect(isConnected -> {
    new WSServer(g, 8050).start();
        System.out.println("MWG Server listener :8050");
    });

This code starts a websocket server on localhost port 8050. Next, we connect a client to the websocket server. 
Graph g = new GraphBuilder()
    .withMemorySize(10000) //cache size before sync to disk
    .withStorage(new WSClient("ws://127.0.0.1:8050"))
    .build();

g.connect(isConnected -> {
    //create new node for world 0 and time 0
    Node sensor = g.newNode(0, System.currentTimeMillis()); 
    sensor.set("id", Math.abs(rand.nextInt()));
    sensor.set("value", rand.nextInt());

    g.index("sensors", sensor, "id", res -> {
        g.save(saveResult -> {
            g.findAll(0, System.currentTimeMillis(), "sensors", 
                allSensorsNow -> {
                System.out.println("All sensors indexed:");
                for (Node sensorNow : allSensorsNow) {
                    System.out.println("\t" + sensorNow.toString());
                }
                g.disconnect(result -> System.out.println("GoodBye!"));
            });
        });
    });
});

This allows clients to use the graph hosted on the server. The above code creates a new sensor graph node, a new index, and saves these changes to the server.

tasks/actions/loop.html.body:
Task Action: Loop
The loop action allows to express the repetition of a sub Task passed as a parameter. Similarly to for loop construction in many imperative language, this action express the iteration over a range, through INCLUSIVE boundaries. 

Additionally the loop action declares automatically a i variable containing the current loop index.

Therefore the following expression: 
loop("0", "3",
    newNode()
    .setProperty("name", Type.STRING, "node_{{i}}")
    .print("{{result}}")
)
.execute(g,null);

Will print the following output in console:
{"world":0,"time":0,"id":1,"name":"node_0"}
{"world":0,"time":0,"id":2,"name":"node_1"}
{"world":0,"time":0,"id":3,"name":"node_2"}
{"world":0,"time":0,"id":4,"name":"node_3"}
In addition, loop action parameters are templates and can express math expression such as "{{=3-1}}" therefore, exclusive bounds can be build this way.
Finally, the loop action is transient and will not modify the current context. Therefore, the task context after the loop action remains unchanged. If a cumulative result has to be built, the best is to use a addToVariable action within the repeated sub task.

tasks/Execute.html.body:
Task execution methods
A task is a prototype of execution that can be defined statically and independently to any graph instances.
A task is executed ON a graph.
The simplest API to do so is the following:
task.execute(graph, null);

If the task aims at returning a result, then the last task context result will be returned in a result callback passed as parameter.
This callback should be of the type of Callback.
Such as:
task.execute(graph, (result)-> {
    //DO something
    if(result != null){
        //you are responsible to free the result set!
        result.free();
    }
});


WARNING: if the callback is not null, you are responsible to free the result, cache full error will occurs otherwise.

ml/polynomial.html.body:
Polynomial compression
Many applications, for example cyber-physical systems or IoT applications, are facing large amounts of rapidly changing data, e.g., measured from sensors. Usually, this data is discretized and stored in timestamp/value pairs. This can easily lead to millions of values in a short amount of time. Besides requiring large amounts of data this makes it also difficult to analyse the large history, e.g., in order to predict future trends. 
Therefore, MWG provides a mechanism, based on machine learning algorithms, which uses polynomials to approximate the timestamp/value signal instead of storing every discrete timestamp/value pair. Machine learning algorithms are applied to learn the polynomial (in live). This significantly improves storage and reasoning costs. The learned polynomial can also be used to predict future trends. 
